import React from 'react';
import FlightRes from '../../General/FlightRes/flightres'
// import Content from './content.js';
class OneWayFlight extends React.Component{
  //the constructor of the component 
  constructor() {
    super(); 
    this.state = { data: [] };//defines the data state
}
  componentDidMount() {
    fetch(`/flight/oneway2`) //fetch API that fetches data from the server to the client
      .then(res => res.json())
      .then(json => this.setState({ data: json }));
}
  render() {
    if(this.state.data.length == 0)
      return (<p>Error</p>)
    return (
      <div id="onewayflights">
        <FlightRes data = {this.state.data}/>
      </div>
    );
  }
}
export default OneWayFlight;
